import React from 'react';
import banner from '../assets/photos/banner.jpg'

const WelcomeSection = () => {
  return (
    <section>
      <div id="shadow">
      <img src={banner} alt="Welcome" />
      </div>
      <p>Chez vous, partout et ailleurs</p>
    </section>
  );
};

export default WelcomeSection;
